import React, { useState } from 'react';
import logo from './fxc.png';
import './App.css';
import Trade from './Trade';
import Login from './Login';

function App() {
  const [isLoggedIn, setIsLoggedIn] = useState(false);

  const handleLogin = () => {
    setIsLoggedIn(true);
  };

  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
       <h2>Loign to Trade</h2>
        <div>
          {isLoggedIn ? <Trade /> : <Login onLogin={handleLogin} />}
        </div>

      </header>
    </div>
  );
}

export default App;
